import React from 'react';

function PreTable (props) {
    return <div id="pre">
        <div className={"hello"}>Привет,<br/>я онлайн</div>
        <div>Есть вопросы? Спрашивай!<br/>Я с ними обязательно справлюсь</div>
    </div>
}

export default PreTable;
